const Searchbar = ({ fetchTeams, teams }) => {



  return (
    <section>
      <button onClick={() => fetchTeams('BL1')}>GO</button>
      {teams.sort().map((team, i) => <div>{team.name}</div>)}
    </section>
  )
};

export default Searchbar;
